@and (binary infix operator) Returns @true if both operands are @true. Returns @false if both operands are @false, or if one is @true and the other @false. More generally: returns RHS if both LHS and RHS are truthy; otherwise, returns the first falsy value. This operator is short-circuiting: if LHS is falsy, RHS will not be evaluated. # Logical AND using booleans
