All functions are objects of the function type, and can be treated like any other variable. When we define a function, we are simply defining a variable and storing it there. To define a function, we need the following: The function signature , enclosed in square brackets [ ], containing: The name of the function, A list of parameters to accept The function body , enclosed by curly braces { }. # Defines a parameterless function named `say-hello` that prints "Hello"
[$say-hello] { Hello
} # Defines a function `greet` with parameter `name` that prints a custom greeting
# Arguments can be accessed like regular variables.
[$greet: name] { Hello, <name>!
} # Defines a function `flip-coin` that returns the value of either `heads` and `tails`
[$flip-coin: heads; tails] { {<heads>|<tails>}
} Like other variables, functions can also be made constant by using % in place of $ when defining them: # Regular functions can be overwritten
[$foo] { hello! }
[$foo] { goodbye! } # Constant function; can't be overwritten
[%foo] { important stuff... } # If we try, the compiler will catch it and produce an error
[%foo] { # ERROR: constant redefinition this won't work
} Note: All of Rant's standard library functions are constants, and thus can't be modified—but they can still be shadowed in child scopes. Default arguments You can also specify a custom default value for an optional parameter by adding an expression after the ? modifier. Each time the function is called without that parameter, Rant will run its default value expression and use its output as the argument. # Modification of the previous [gen-pet] to use a default value instead of calling [alt]
[$gen-pet: name; species ? "dog"] { @( name = <name>; species = <species>; # No fallback needed! )
} Note: Default argument expressions can capture external variables just like the body of the function they're attached to.

